#Enigme 4
#- Trier la chaine suivante en ordre alphabétique
#
#- Faire une liste avec le nombre d'occurence pour chaque lettre
#- 100-> Représente a, 101 Réprésente b, 102 représente c... etc 125 représente z. L'espace est représenté par 126
#- Saisir le message trouvé
#Solution: journee dev expectra

from collections import OrderedDict  
t = ["a","b","c","d","e","f","g","h","i","j","k","l","m","n","o","p","q","r","s","t","u","v","w","x","y","z"," "]
a=""
l=list(a)
l.sort()	

def group_list(lst):       
    res =  [(el, lst.count(el)) for el in lst] 
    return list(OrderedDict(res).items()) 
	
def trad(e):
	try:
		n=int(e)-100
	except:
		raise
	return t[n]

g=group_list(l)
for i in range(len(g)):
	print(trad(g[i][1]), end="")
